import{_ as a,c as t,o as d,U as b,AG as e,AH as c}from"./chunks/framework._bMY95IQ.js";const m=JSON.parse('{"title":"Rainbow x Icevan v1.1","description":"","frontmatter":{"layout":"doc","outline":"deep"},"headers":[],"relativePath":"technical_docs/device_icevan.md","filePath":"technical_docs/device_icevan.md"}'),i={name:"technical_docs/device_icevan.md"},v=b('<h1 id="rainbow-x-icevan-v1-1" tabindex="-1" data-v-7cbb91da>Rainbow x Icevan v1.1 <a class="header-anchor" href="#rainbow-x-icevan-v1-1" aria-label="Permalink to &quot;Rainbow x Icevan v1.1&quot;" data-v-7cbb91da>​</a></h1><h3 id="_1-configuration-setting" tabindex="-1" data-v-7cbb91da>1. CONFIGURATION &amp; SETTING <a class="header-anchor" href="#_1-configuration-setting" aria-label="Permalink to &quot;1. CONFIGURATION &amp; SETTING&quot;" data-v-7cbb91da>​</a></h3><p data-v-7cbb91da><img src="'+e+'" alt="missing" data-v-7cbb91da></p><ul data-v-7cbb91da><li data-v-7cbb91da>Connect a commercial USB-RS232 (USB-serial) device to the control box of Rainbow Robot</li><li data-v-7cbb91da>Communication lines between devices should be cross-connected / Connect the GND (ground) wires on both sides. (Common ground)</li><li data-v-7cbb91da>Icevan equipment uses serial communication speed/Baud rate as 9600 bps, so set the rainbow control box accordingly.</li></ul><p data-v-7cbb91da><img src="'+c+'" alt="missing" data-v-7cbb91da></p><h3 id="_2-variable-description" tabindex="-1" data-v-7cbb91da>2. VARIABLE DESCRIPTION <a class="header-anchor" href="#_2-variable-description" aria-label="Permalink to &quot;2. VARIABLE DESCRIPTION&quot;" data-v-7cbb91da>​</a></h3><div class="warning custom-block" data-v-7cbb91da><p class="custom-block-title" data-v-7cbb91da>WARNING</p><ul data-v-7cbb91da><li data-v-7cbb91da>In the table below, the information in the yellow area is the information transmitted by Icevan (ice machine).</li><li data-v-7cbb91da>The values stored in the variables in the yellow area contain the information that the Icevan transmits to the Rainbow-ControlBox through communication.</li></ul></div><table class="th-align" data-v-7cbb91da><tr data-v-7cbb91da><th data-v-7cbb91da>Variable Name</th><th data-v-7cbb91da>Description</th><th data-v-7cbb91da>Ref. Icevan Manual</th></tr><tr data-v-7cbb91da><td class="bg-none" data-v-7cbb91da>ICE_INFO_CONNECTED</td><td data-v-7cbb91da>Whether it is communicating with the Icevan</td><td data-v-7cbb91da></td></tr><tr data-v-7cbb91da><td class="bg-none" data-v-7cbb91da>ICE_INFO_REQUESTING</td><td data-v-7cbb91da>*RB developer only</td><td data-v-7cbb91da></td></tr><tr data-v-7cbb91da><td class="bg-none" data-v-7cbb91da>ICE_INFO_USING</td><td data-v-7cbb91da>*RB developer only</td><td data-v-7cbb91da></td></tr><tr data-v-7cbb91da><td class="bg-none" data-v-7cbb91da>ICE_INFO_VECSIZE</td><td data-v-7cbb91da>*RB developer only</td><td data-v-7cbb91da></td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_INFO_MODE_COMM</td><td data-v-7cbb91da>1:Communication mode / 0:Normal mode</td><td data-v-7cbb91da>Chap. 1</td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_INFO_MODE_CUP</td><td data-v-7cbb91da>1:Ignore Cup depart / 0: Stop Ice-out if Cupdepart</td><td data-v-7cbb91da>Chap. 1</td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_INFO_TIME_ICE</td><td data-v-7cbb91da>Last Ice-out time</td><td data-v-7cbb91da></td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_INFO_TIME_WATER</td><td data-v-7cbb91da>Last Water-out time</td><td data-v-7cbb91da></td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_INFO_AMBI_LOW</td><td data-v-7cbb91da>Lower limit for ambient temperature setting</td><td data-v-7cbb91da>Chap. 4</td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_INFO_AMBI_HIGH</td><td data-v-7cbb91da>Upper limit for ambient temperature setting</td><td data-v-7cbb91da>Chap. 4</td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_INFO_TEMP_AMBI</td><td data-v-7cbb91da>Temperature : Ambient</td><td data-v-7cbb91da>Chap. 5</td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_INFO_TEMP_EVAPO</td><td data-v-7cbb91da>Temperature : Evaporator</td><td data-v-7cbb91da>Chap. 5-1</td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_INFO_TEMP_CONDEN</td><td data-v-7cbb91da>Temperature : Condensor</td><td data-v-7cbb91da>Chap. 5-1</td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_STATE_LAST_ICE_NO</td><td data-v-7cbb91da>If ice is not detected in the previous ice-out</td><td data-v-7cbb91da>Manual: ignore this</td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_STATE_LAST_ICE_YES</td><td data-v-7cbb91da>If ice is detected in the previous ice-out</td><td data-v-7cbb91da>Manual: ignore this</td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_STATE_COMP_WORK</td><td data-v-7cbb91da>Whether the compressor works (1=working)</td><td data-v-7cbb91da>Page 3 upper table</td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_STATE_MOTOR_WORK</td><td data-v-7cbb91da>Whether the gear-motor works (1=working)</td><td data-v-7cbb91da>Page 3 upper table</td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_STATE_OUT_SOL</td><td data-v-7cbb91da>Ice-out SOL detection (1=detected)</td><td data-v-7cbb91da>Page 3 upper table</td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_STATE_CUP_LEVEL</td><td data-v-7cbb91da>Cup lever detection (1=detected)</td><td data-v-7cbb91da>Page 3 upper table</td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_STATE_COMM_MODE</td><td data-v-7cbb91da>1 if communication mode</td><td data-v-7cbb91da>Page 3 upper table</td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_STATE_FULL_ICE</td><td data-v-7cbb91da>Ice-Full signal (1 = Full Ice)</td><td data-v-7cbb91da>Page 3 upper table</td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_STATE_ERR_1</td><td data-v-7cbb91da>*RB developer only</td><td data-v-7cbb91da></td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_STATE_ERR_2</td><td data-v-7cbb91da>*RB developer only</td><td data-v-7cbb91da></td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_STATE_ERR_3</td><td data-v-7cbb91da>*RB developer only</td><td data-v-7cbb91da></td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_STATE_ERR_4</td><td data-v-7cbb91da>*RB developer only</td><td data-v-7cbb91da></td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_STATE_ERR_CODE</td><td data-v-7cbb91da>Error code (0 = Normal)</td><td data-v-7cbb91da>Page 3 lower table</td></tr><tr data-v-7cbb91da><td data-v-7cbb91da>ICE_STATE_RD</td><td data-v-7cbb91da>1=Ready to IceOut / 0=IceOut done or Timeout</td><td data-v-7cbb91da>Page 3 middle table</td></tr></table><h3 id="_3-function-description" tabindex="-1" data-v-7cbb91da>3. FUNCTION DESCRIPTION <a class="header-anchor" href="#_3-function-description" aria-label="Permalink to &quot;3. FUNCTION DESCRIPTION&quot;" data-v-7cbb91da>​</a></h3><br data-v-7cbb91da><h4 id="_3-1-icevan-update-start" tabindex="-1" data-v-7cbb91da>3.1 icevan_update_start(#) <a class="header-anchor" href="#_3-1-icevan-update-start" aria-label="Permalink to &quot;3.1 icevan_update_start(#)&quot;" data-v-7cbb91da>​</a></h4><ul data-v-7cbb91da><li data-v-7cbb91da><p data-v-7cbb91da>icevan_update_start(#)<br data-v-7cbb91da></p><p data-v-7cbb91da>Start requesting status/setting information from the ice machine</p><p data-v-7cbb91da>Input :</p><blockquote data-v-7cbb91da><p data-v-7cbb91da>1: Data request Start<br data-v-7cbb91da> 0: Data request End</p></blockquote><p data-v-7cbb91da>Example :</p><div class="language- vp-adaptive-theme" data-v-7cbb91da><button title="Copy Code" class="copy" data-v-7cbb91da></button><span class="lang" data-v-7cbb91da></span><pre class="shiki shiki-themes github-light github-dark vp-code" data-v-7cbb91da><code data-v-7cbb91da><span class="line" data-v-7cbb91da><span data-v-7cbb91da>icevan_update_start(1)</span></span></code></pre></div></li></ul><h4 id="_3-2-icevan-set-mode" tabindex="-1" data-v-7cbb91da>3.2 icevan_set_mode(#, #) <a class="header-anchor" href="#_3-2-icevan-set-mode" aria-label="Permalink to &quot;3.2 icevan_set_mode(#, #)&quot;" data-v-7cbb91da>​</a></h4><ul data-v-7cbb91da><li data-v-7cbb91da><p data-v-7cbb91da>icevan_set_mode(#, #)<br data-v-7cbb91da></p><p data-v-7cbb91da>Select the operation mode of the ice machine (Ref. Icevan Manual Chap.1)</p><p data-v-7cbb91da>Input :</p><blockquote data-v-7cbb91da><p data-v-7cbb91da>First value:<br data-v-7cbb91da> 1: Communication Mode (via RS232)<br data-v-7cbb91da> 0: Normal Mode</p></blockquote><blockquote data-v-7cbb91da><p data-v-7cbb91da>Second value:<br data-v-7cbb91da> 1: Ignore cup-depart (Ice will be out even if the cup is departed)<br data-v-7cbb91da> 0: Stop the ice-out when the cup is departed</p></blockquote><p data-v-7cbb91da>Example :</p><div class="language- vp-adaptive-theme" data-v-7cbb91da><button title="Copy Code" class="copy" data-v-7cbb91da></button><span class="lang" data-v-7cbb91da></span><pre class="shiki shiki-themes github-light github-dark vp-code" data-v-7cbb91da><code data-v-7cbb91da><span class="line" data-v-7cbb91da><span data-v-7cbb91da>icevan_set_mode(1, 1) # Set the operation mode of the ice machine to communication mode</span></span></code></pre></div></li></ul><h4 id="_3-3-icevan-set-timeout" tabindex="-1" data-v-7cbb91da>3.3 icevan_set_timeout(#) <a class="header-anchor" href="#_3-3-icevan-set-timeout" aria-label="Permalink to &quot;3.3 icevan_set_timeout(#)&quot;" data-v-7cbb91da>​</a></h4><ul data-v-7cbb91da><li data-v-7cbb91da><p data-v-7cbb91da>icevan_set_timeout(#)<br data-v-7cbb91da></p><p data-v-7cbb91da>Ice dispensing timeout setting (timeout when ice is not removed) (Ref. Icevan Manual Chap.6)</p><p data-v-7cbb91da>Input :</p><blockquote data-v-7cbb91da><p data-v-7cbb91da>Time (Unit: second)</p></blockquote><p data-v-7cbb91da>Example :</p><div class="language- vp-adaptive-theme" data-v-7cbb91da><button title="Copy Code" class="copy" data-v-7cbb91da></button><span class="lang" data-v-7cbb91da></span><pre class="shiki shiki-themes github-light github-dark vp-code" data-v-7cbb91da><code data-v-7cbb91da><span class="line" data-v-7cbb91da><span data-v-7cbb91da>icevan_set_timeout(600)</span></span></code></pre></div></li></ul><h4 id="_3-4-icevan-set-airtemp" tabindex="-1" data-v-7cbb91da>3.4 icevan_set_airtemp(#, #) <a class="header-anchor" href="#_3-4-icevan-set-airtemp" aria-label="Permalink to &quot;3.4 icevan_set_airtemp(#, #)&quot;" data-v-7cbb91da>​</a></h4><ul data-v-7cbb91da><li data-v-7cbb91da><p data-v-7cbb91da>icevan_set_airtemp(#, #)<br data-v-7cbb91da></p><p data-v-7cbb91da>Set for the ambient temperature limit (lower/upper settings) (Ref. Icevan Manual Chap.8)</p><p data-v-7cbb91da>Input :</p><blockquote data-v-7cbb91da><p data-v-7cbb91da>First value : Lower temperature setting : (0~10)<br data-v-7cbb91da> Second value : Upper temperature setting : (40~70)</p></blockquote><p data-v-7cbb91da>Example :</p><div class="language- vp-adaptive-theme" data-v-7cbb91da><button title="Copy Code" class="copy" data-v-7cbb91da></button><span class="lang" data-v-7cbb91da></span><pre class="shiki shiki-themes github-light github-dark vp-code" data-v-7cbb91da><code data-v-7cbb91da><span class="line" data-v-7cbb91da><span data-v-7cbb91da>icevan_set_airtemp(5, 65)</span></span></code></pre></div></li></ul><h4 id="_3-5-icevan-out" tabindex="-1" data-v-7cbb91da>3.5 icevan_out(#, #) <a class="header-anchor" href="#_3-5-icevan-out" aria-label="Permalink to &quot;3.5 icevan_out(#, #)&quot;" data-v-7cbb91da>​</a></h4><ul data-v-7cbb91da><li data-v-7cbb91da><p data-v-7cbb91da>icevan_out(#, #)<br data-v-7cbb91da></p><p data-v-7cbb91da>Most core function. Ice/Water output function (Ref. Icevan Manual Chap.2)</p><p data-v-7cbb91da>Input :</p><blockquote data-v-7cbb91da><p data-v-7cbb91da>First value : Time for ice-out (Unit: second)<br data-v-7cbb91da> Second value : Time for water-out (Unit: second)</p></blockquote><p data-v-7cbb91da>Example :</p><div class="language- vp-adaptive-theme" data-v-7cbb91da><button title="Copy Code" class="copy" data-v-7cbb91da></button><span class="lang" data-v-7cbb91da></span><pre class="shiki shiki-themes github-light github-dark vp-code" data-v-7cbb91da><code data-v-7cbb91da><span class="line" data-v-7cbb91da><span data-v-7cbb91da>icevan_out(5.7, 0) # Make Ice during 5.7 second and water during 0 second</span></span></code></pre></div></li></ul><h4 id="_3-6-icevan-reset" tabindex="-1" data-v-7cbb91da>3.6 icevan_reset() <a class="header-anchor" href="#_3-6-icevan-reset" aria-label="Permalink to &quot;3.6 icevan_reset()&quot;" data-v-7cbb91da>​</a></h4><ul data-v-7cbb91da><li data-v-7cbb91da><p data-v-7cbb91da>icevan_reset()<br data-v-7cbb91da></p><p data-v-7cbb91da>Reset machine (Ref. Icevan Manual Chap.7)</p><p data-v-7cbb91da>Input :</p><blockquote data-v-7cbb91da><p data-v-7cbb91da>None</p></blockquote><p data-v-7cbb91da>Example :</p><div class="language- vp-adaptive-theme" data-v-7cbb91da><button title="Copy Code" class="copy" data-v-7cbb91da></button><span class="lang" data-v-7cbb91da></span><pre class="shiki shiki-themes github-light github-dark vp-code" data-v-7cbb91da><code data-v-7cbb91da><span class="line" data-v-7cbb91da><span data-v-7cbb91da>icevan_reset()</span></span></code></pre></div></li></ul><h4 id="_3-7-icevan-clear" tabindex="-1" data-v-7cbb91da>3.7 icevan_clear() <a class="header-anchor" href="#_3-7-icevan-clear" aria-label="Permalink to &quot;3.7 icevan_clear()&quot;" data-v-7cbb91da>​</a></h4><ul data-v-7cbb91da><li data-v-7cbb91da><p data-v-7cbb91da>icevan_clear()<br data-v-7cbb91da></p><p data-v-7cbb91da>Clear all information (As explained by Ice Van manual, this function exists but doesn&#39;t work.)</p><p data-v-7cbb91da>Input :</p><blockquote data-v-7cbb91da><p data-v-7cbb91da>None</p></blockquote><p data-v-7cbb91da>Example :</p><div class="language- vp-adaptive-theme" data-v-7cbb91da><button title="Copy Code" class="copy" data-v-7cbb91da></button><span class="lang" data-v-7cbb91da></span><pre class="shiki shiki-themes github-light github-dark vp-code" data-v-7cbb91da><code data-v-7cbb91da><span class="line" data-v-7cbb91da><span data-v-7cbb91da>icevan_clear()</span></span></code></pre></div></li></ul>',24),o=[v];function n(r,s,l,p,u,_){return d(),t("div",null,o)}const I=a(i,[["render",n],["__scopeId","data-v-7cbb91da"]]);export{m as __pageData,I as default};
